INSERT INTO `funkit` (`id_funkit`, `name`, `text`, `img`, `color`, `date`, `show`, `order_index`, `requests`) VALUES
(23, 'ערכה להפסקות', '● משחקים ללא ציוד שהופכים את ההפסקות למעצימות \n● משחקים המחזקים יצירתיות, ביטחון עצמי ומיומנויות חברתיות\n● עם הערכה בתיק הילדים יוצאים בבוקר בכיף וחוזרים שמחים', 'http://playlist.motowelove.com/storage/funkit/4qB7nsXpyI4scOgy', '#D2E36B', 1554709388, 1, 1, 1),
(24, 'ערכה למורה', '● משחקים ללמידה בכיף, לשינון ולהפנמת החומר בהנאה\n● משחקים לגיבוש הכיתה, ולהעברת מסרים ערכיים מגוונים\n● משחקים לפיתוח חשיבה חשבונית ויכולות מילוליות ואנגלית\n', 'http://playlist.motowelove.com/storage/funkit/ZS5OXkLhCijkl5qP', '#E5CA37', 1554709609, 1, 4, 1),
(27, 'ערכה למדריכים ומנחים', '● משחקים לגיבוש, היכרות וליצירת אווירה מחברת\n● משחקים לכיף המחזקים מנהיגות והובלה של המדריך\n● להעברת מסרים בכלים חווייתיים ', 'http://playlist.motowelove.com/storage/funkit/bgJN6QpBby2jEMTf', '#C286FF', 1554709802, 1, 2, 3),
(30, 'ערכה לחופשה', '● משחקים לנסיעה, לפיקניק, לטיול ולמלון\n● מדהימים את החברים במשחקים מגניבים\n● מנצלים את האווירה  לקרבה ולצחוקים', 'http://playlist.motowelove.com/storage/funkit/Z6lm0Jl1zanbCtPB', '#7DD966', 1554710312, 1, 5, 0),
(33, 'ערכה לדייטים ולזוגיות', '● משחקים לדייט - עם בן/ת הזוג או עם הפוטנציאליים\n● יוצרים שיח אינטימי / זורם / מצחיק / מקרב\n● חושפים את הילד שבך ומתחברים זה לזו משם', 'http://playlist.motowelove.com/storage/funkit/GfxJafT6p5snrGsi', '#D24678', 1554955796, 1, 6, 0),
(34, ' ערכה לגיבוש משפחתי', '● אלטרנטיבה חברתית למסכים\n● משחקים שיוצרים שיח הורה-ילד משמעותי\n● המענה הערכי המדויק לנהמה בחופשות: \"אמא, משעמם לי!\"...', 'http://playlist.motowelove.com/storage/funkit/iwZcbeshjGhK4XCl', '#FF7384', 1554955914, 1, 3, 0),
(42, 'ערכה לכיף בכל מצב...', '● מגוון שאלות לשיחה זורמת, מצחיקה ומחברת\n● לארוחה משפחתית, לנסיעה, למפגש חברתי, לדייט, ולכל מצב...', 'http://playlist.motowelove.com/storage/funkit/hmr4zQP6bYTupq7w', '#C286FF', 1554956934, 1, 7, 0),
(43, 'מנוי כמתנת יומולדת', '● מתנת יומולדת ערכית, מיוחדת ונוצצת - מבלי להתרוצץ בחנויות  \n● יוצאים מ playlist, נרשמים מחדש עם שם וטלפון של מקבל המתנה, ועושים מנוי \n● שולחים לו בווטסאפ: מזל טוב! כמתנת יומולדת עשינו לך מנוי למאגר משחקים חברתיים כייפים! . שם משתמש: ____ סיסמה: ____ www.palylistgame.com', 'http://playlist.motowelove.com/storage/funkit/Y0rGnIyhsURoLvpH', '#D2E36B', 1560610669, 1, 8, 0);
