INSERT INTO `playlist` (`id_playlist`, `question_1`, `question_2`, `question_3`, `question_4`, `question_5`, `video`, `date`, `section`, `name`, `additional`, `gender`, `level`, `show`, `edited`, `id_author`, `min_players`, `max_players`, `min_age`, `max_age`, `id_school`, `order_index`, `city`, `img`) VALUES
