(110, 'א\' מנסה לתפוס שחקן מהקבוצה, בזמן שכולם בורחים ממנו', 'התופס מכריז על צבע כלשהו, וכל שחקן שנוגע במשהו בצבע המוכרז מוגן מתפיסה', '', NULL, NULL, NULL, 1555657479, 'mix', 'תופסת צבעים', 0, 'two', 1, 0, 1556542092, NULL, 3, 13, 6, 13, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/dsw77GdwmxxbQ6fj'),
(111, 'המשתתפים נחלקים ל-2 קבוצות, ונעמדים ב-2 שורות אלה מול אלה במרחק של כ-50 מטר', 'א\' ניגש לקבוצה השנייה שמול, שכל חבריה מושיטים יד קדימה ומכה על כף יד אחת בהכריזו: \"תיפ\"!', 'ואז הוא מכה על כף יד של שחקן אחד ומכריז \"סו\"!. ועל השלישי \"ני\". השלישי צריך לתפוס אותו לפני שהמכה חוזר בריצה לקבוצתו', 'הנתפס שבוי, עד שזה שתפס אותו נתפס גם הוא', 'אם הרודף לא הצליח לתפוס - הוא שבוי של הנרדף', NULL, 1555657676, 'mix', 'תפסוני', 1, 'two', 1, 1, 1567620428, NULL, 4, 12, 9, 13, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/CT1nVXAjbyJWglrY'),
