(113, 'משחקים כדורגל עם שער אחד. יש שוער אחד, וכולם קבוצה אחת מולו', 'אין לגעת בכדור פעמיים ברצף', 'גול יחשב רק אם היתה הבקעה מכדור שהיה באוויר, ולא מהקרקע', NULL, '', NULL, 1555657988, 'mix', 'וולה', 0, 'man', 2, 1, 1556541089, NULL, 3, 7, 13, 25, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/kb9c9VTRpRPu000n'),
