(116, 'בוחרים תחום, כגון: חיות, מנהיגים, רגשות, מקצועות, ארצות, תכונות, מילים נרדפות', 'סופרים: \"שלוש, ארבע ו...\", ואומרים ביחד מילה בתחום שהוגדר. לקבוצה מתווסף ניקוד כמספר המילים השונות שנאמרו', 'הניקוד שהצטבר נמחק אם נאמרו שתי מלים זהות. ההצלחה תלויה ביכולת למצוא מיוחדים ששייכים לתחום', 'עדיף תחום אישי ומשמעותי, כגון: מאפיינים של סבא, דברים חשובים להצלחה בחיים, דברים טובים שקרו לנו השנה', '', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YBk3IBUqc9o\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1555661421, 'mix', 'מיוחדים', 1, 'two', 2, 1, 1559195143, NULL, 2, 10, 10, 65, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/MpOjhz74OwvAu88L'),
(117, 'כותבים על פתקים מושגים מתוך חומר שרוצים ללמוד, כגון: אישים, ארצות, תקופות, ביטויים, רגשות, מצבים', 'קבוצה א\' מתארת את הכתוב בפתק שבידה. כשקבוצה ב\' מצליחה לפענח, הפתק עובר אליה', 'כשכל הפתקים הועברו, קבוצה ב\' מתארת את אותם הפתקים בחזרה לקבוצה א\' - אך במילה אחת בלבד', 'לאחר שכל הפתקים הוחזרו לקבוצה א\', היא מתארת שוב לקבוצה ב\' את הכתוב באותם פתקים - אך בפנטומימה', '', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/edxh9fTxoFA\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1555661649, 'mix', 'הקיצר', 1, 'two', 2, 1, 1559198581, NULL, 2, 30, 10, 65, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/dy1zv9TAsreRszy0'),
