(119, 'מגדירים נקודה מרוחקת. המטרה היא להגיע אליה מה שיותר מהר', 'א\' מתחיל לספור בדממה עד שב\' עוצר אותו באמירת \"סטופ!\". אחר כך שוב, אך הפעם ב\' הוא הסופר', 'א\' מחשב את ההפרש בין המספרים שהתקבלו, ובזמן החישוב ב\' מתקדם אל היעד במהירות עקב בצד אגודל', 'אם השחקן שתורו לחשב אומר תוצאה שגויה, עליו ללכת אחורה עשרה צעדים', 'במקום חיבור, הכפלת המספרים', NULL, 1555661993, 'mix', 'חילזון גאון', 1, 'two', 2, 1, 1556539874, NULL, 2, 2, 6, 65, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/ZIPcxtZAiYlJus00'),
