(191, 'במעגל, א\' שר איזה שיר שרוצה', 'במרכז המעגל \'כפתור אדום\' גדול דמיוני, עליו לוחץ עם כף היד מי שרוצה מתי שרוצה - ואז הלוחץ שר שיר אחר', 'רק כשמישהו לוחץ יכול א\'  להפסיק לשיר. אם הוא אינו יודע עוד את המשך המילים של השיר הוא צריך להמציא מילים ', 'אפשר במקום שיר, נאום בנושא כלשהו, שהנואם חייב להמשיך עד שמתחיל נאום חדש', '', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/PvtyjiTvHV8\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1556414689, 'mix', 'כוכב נולד', 1, 'two', 3, 1, 1559824971, NULL, 2, 12, 12, 52, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/JRtWsLNqX7Sty2Dm'),
(192, 'א\' מדבר בפני השאר בג\'יבריש בהברות חסרות משמעות, כגון: אסלפפא שליגלוץ בוטוטו', 'א\' הוא שגריר שנואם בדרמטיות בשפתו הלא מוכרת בפני השאר, וב\' עומד לידו ו\'מתרגם\' כל משפט לקהל', 'נאום השגריר הוא בנושא שהוגדר מראש, כגון: מדוע צריכים כולם לנסוע רק באופניים, או תמיכה נלהבת במעבר האנושות לירח ', 'קהל השומעים מוזמן למחוא כפיים במקומות הנכונים, והמתרגם או הנואם יכולים לרמוז להם מתי זה מתבקש', NULL, '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/fLi4Milsh-o\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1556414975, 'mix', 'נאום השגריר', 1, 'two', 3, 1, 1559823212, NULL, 4, 20, 12, 52, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/T1DZmLCT6tP5ylyO'),
