(328, 'א\' אומר שעה וב\' עושה ביד שמאל ישרה את מחוג השעות ובימין את מחוג הדקות. אצבעות סגורות מבטאות\n PM	\n\n', 'א\' אומר שעה חדשה או אומר שחלף זמן מסוים, וב\' משקף כשעון את השעה החדשה	', 'אפשרות: א\' מספר סיפור דמיוני או מוכר או את סדר יומו מאתמול, וב\' משקף כשעון את השעות שנאמרות בסיפור', '	ב\' יכול להזיז את השעון גם מבלי שא\' הכריז על שעה חדשה, וא\' צריך להתאים את הסיפור לזמן שחלף כפי שמראה השעון	', 'ב\' יכול להחליט שיד שמאל מבטאת שניות, וא\' צריך להתאים את הסיפור לקצב התקדמות הזמן', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Zy_TaItC-oo\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1559792666, 'mix', 'השעון ', 1, 'two', 1, 1, 1560524926, 133, 2, 4, 5, 12, NULL, 0, 'ירושלים', 'http://playlist.motowelove.com/storage/playlist/njmapfG6n1lNvN13'),
