(332, 'א\' וב\' מנהלים דו-שיח של משפט משפט		\n', 'אחרי שא\' אמר משפט, ב\' משיב לו במשפט שכולל מילה אחת שהיתה במשפט שאמר א\'', 'דוגמה: א\': \"שלום אדוני, ראית אולי את הכלב שלי?\". ב\': \"לא, ראיתי את הכלב של ראש העיר\". א\': \"אוי! ראש העיר מעדיף חתולים\". ב\': \"אני מעדיף שנשב\"', '	מנהלים שיחה ללא השתהות. מי שמתמהמה עובר לסוף הטור והבא אחריו משיב במהירות', NULL, '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/h7IQ1FxCpAo\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1559830166, 'mix', 'שרשרת', 1, 'two', 1, 1, 1559831155, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/UY9f8Y8ViU2LESg2'),
