(360, 'א\' אומר מחמאה על מישהו מהקבוצה 	', 'ב\' אומר מחמאה שמתחילה באות שונה מהאות שהתחילה את  המחמאה שנתן א\'. המחמאה של ב\' תהיה כלפי מישהו אחר מהקבוצה	\n', 'המחמאות ניתנות לא לפי סבב אלא בשיטת \'פופקורן\' כשכל אחד קופץ לומר מתי שרוצה, עד שכולם מחמיאים וכולם מקבלים מחמאה	', 'ממשיכים בסבבים נוספים כשבכל פעם מחמיאים על מישהו אחר מאלו שהחמאת להם בסבבים הקודמים', ' ניתן לסיים בתודות, כשכל אחד מודה אישית לנותן המחמאה שריגשה אותו במיוחד,  ובשיקוף של ההרגשה אחרי קבלת ונתינת המחמאות', NULL, 1565343816, 'mix', 'מלך הפירגונים', 1, 'two', 2, 1, 1565589454, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/NJd9HAGGPky3CviE'),
