(362, 'כל אחד קובע לעצמו בלב תגובה שיגיב כאשר מישהו יעשה פעולה מסוימת	 ', 'דוגמה: אצעק ווייי כאשר מישהו יגע בשער שלו, אגע בשיער כשמישהו יגיד מילה עם האוט ט\', \'אחפור\' דקה כשמישהו יחייך, אשתעל כשמישהו \'יחפור\'	', 'כל אחד יכול להחליט מתי שירצה לשנות את תגובותיו ואת הגורם להן. המשחק יכול להיות לא מוגדר בזמן אלא במהלך היום או הטיול וכד\'	', 'מטרה: לזהות את גורמי הפעולה של אחרים, להתאים את שלי, ולהגיע למצב של \'פיצוץ גרעיני\' כשפעולה של אחד מפעילה את כולם\n', NULL, NULL, 1565348950, 'mix', 'פיצוץ שרשרת', 1, 'two', 3, 1, 1565589208, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/l5n4Y1gnIoY4iePe'),
