(367, 'א\' וב\' מעלים מקרה מהחיים של אתגר ביחסים עם חברים או בני משפחה, כגון: מריבה, ויכוח, אגו, לא פייר וכד\' 	', 'כל אחד משחק תפקיד ומנסה \'להצליח\' בוויכוח. א\' וב\' יכולים לתכנן האם \'להצליח\' זה \'לנצח\' את השני או לרתום אותו 	', 'ג\' מקשיב מהצד ויכול בכל שלב להכריז: \"להחליף!\". כשהכריז, א\' וב\' ממשיכים את הדו-שיח מאותה נקודה אבל בחילופי תפקידים ביניהם. ג\' רשאי להכריז מתי שירצ', NULL, NULL, NULL, 1565418794, 'mix', 'אני-אתה', 0, 'two', 1, 1, 1565419063, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/pcI5xnDgfu0tHAmc'),
