(369, 'מעגל. א\' אומר לב\' שמשמאלו אמירה סתמית לגמרי ובטון נטול רגש	\n', 'ב\' מגיב לדברים בעוצמה רגשית קיצונית בכל רגש שיבחר: תדהמה, אושר, כעס, בוז, צער, חוסר אמון, סיפוק וכו\'	', 'דוגמה: א\': \"היום יום שלישי\". ב\': \"מה??!! אז ישנתי עכשיו ארבע ימים רצוף?? ופספסתי את מבחן הקבלה להיות אסטרונאוט!! לאאאאא!!\". ואז ב\' אומר משפט סתמי לג\', ו', NULL, NULL, NULL, 1565420839, 'mix', 'היום יום שלישי', 0, 'two', 3, 1, 1565589090, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/uiZe6aBfMZDifRaL'),
