(373, 'א\' מדבר מול שאר המשתתפים, וב\' לידו רשאי להכנס לדבריו מתי שירצה ולהמשיך את דבריו של א\'	', 'א\' וב\' הם \'תאומים\' שמסכימים על כל דבר, ודבריו של ב\' יהיו המשך והסכמה לדבריו של א\'		', 'בזמן שב\' מדבר א\' מביע בפניו הסכמה מלאה עם דברי ב\', עד שהוא מתפרץ וממשיך בהסכמה את דבריו של ב\'. וכך הלאה', 'א\' וב\' מוזמנים לאתגר אחד את השני ולומר דברים שידוע להם שיהיה לשני קשה להסכים אתם. \"...\n', 'דוגמה: א\': \"הפועל היא הקבוצה הכי טובה בארץ\"... ב\', שהוא אוהד בית\"ר: \"לגמרי הכי טובים', NULL, 1565503316, 'mix', 'תאומים', 1, 'two', 1, 1, 1565503860, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/iN7hPxpZGLDdNN88'),
