(375, 'א\' וב\' עומדים זה מול זה ומוחאים כפיים ביחד בדיוק באותו הקצב	', 'מידי פעם לאט לאט וללא דיבורים אחד מהם מאט או מגביר את הקצב, והשני צריך להתאים את עצמו כך שתשמר אחידות המחיאות כפיים	', 'אין הגדרה מי מוביל וכל אחד צריך מידי פעם להוביל שינוי ומידי פעם להתאים את עצמו לשינוי שקבע השני. לאחר שתי דקות מחליפים בן זוג	', 'ניתן להוסיף לעיתים תנועות נוספות מעבר למחיאות כפיים, למשל משיכה בתנוך האוזן\n', NULL, NULL, 1565507554, 'mix', 'באותו ראש', 1, 'two', 1, 1, 1565507795, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/4abuWx8YnGlfTxMf'),
(376, 'המשתתפים מסתובבים בחדר 	\n', 'כשניתן הסימן כל אחד ניגש למישהו ואומר לו בסוד מחמאה. מקבל המחמאה לא מחזיר מחמאה אלא שומע וממשיך	', 'לאחר שכולם קיבלו מחמאות מכולם ממשיכים בסבב נוסף בו הלוחש באוזן אומר מחמאה על עצמו	', 'רצוי להמשיך לסבבים נוספים של מחמאה נוספת מכל אחד', 'בשלב הבא לוחשים באוזן מה ראוי לשיפור אצל השני, ובשלב הבא מה ראוי לשיפור אצל הלוחש', NULL, 1565509621, 'mix', 'סודות מתוקים', 1, 'two', 2, 1, 1567619288, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/faH9vRoRWYzqL4Yp'),
