(378, 'א\' וב\' יושבים ומנהלים דו-שיח על נושא דמיוני או על עניין אמיתי מחייהם', 'בכל שלב יכול כל אחד מהם לשים לב למחשבה שיפוטית במוחו, לעמוד מאחורי כיסאו ולבטא מחשבה זו בקול בשם \'השד הפנימי. כגון: \"אולי מה שאמרתי עכשיו היה ט', 'לאחר שביטא את הקול של \'השד הפנימי\' הוא חוזר לכיסאו, וממשיכים בדיאלוג כרגיל. לא מתייחסים לדברי \'השד הפנימי\'', 'מי שמבטא את \'השד הפנימי\' יכול לבטא מחשבות השיפוטיות בראשו גם בזמן שביטא את \'השד הפנימי\', ללכת צעד אחורה ולבטא את המחשבות השיפוטיות בראשו בזמן', 'זהו משחק ברמה גבוהה מאוד, מאתגר ומפתח. ברמה גבוהה עוד יותר זה נעשה מול קהל הקבוצה', NULL, 1565531734, 'mix', 'השד', 1, 'two', 3, 1, 1565539502, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/JhQb8g90mYluBGdO'),
(379, 'א\' עושה צורה כלשהי עם גופו ונשאר כך \'קפוא\' בלי לזוז	\n', 'ב\' מצטרף אליו ומוסיף לפסל הקבוצתי הנבנה את גופו בתנוחה כלשהי, וכך הלאה שאר המשתתפים המעוניינים 	', 'אלו שלא הצטרפו לפסל הם המפסלים שיכולים להזיז את ידיהם או גופם של השותפים בפסל שצורתו משתנה כל העת ', 'כל מפסל יכול לעבור ולהיות חלק מהפסל, והמשתתפים בפסל יכולים לצאת ולהיות מפסלים', NULL, NULL, 1565535112, 'mix', 'פסל קבוצתי', 1, 'two', 3, 1, 1565588994, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/mZ5sSHgJvk9HRhnF'),
(380, 'כל היוצאים מקו הזינוק שואגים את שמם במהלך הריצה	', 'כשנגמר לרץ האוויר בשאגת שמו הוא נעצר	', 'הוא לוקח אוויר לשאגה נוספת של שמו, ויוצא למקטע נוסף עד שיעצר שוב כשלא יוכל לצעוק עוד את שמו. כך שוב ושוב עד ליעד שהוגדר\n', NULL, NULL, NULL, 1565538928, 'mix', 'מרוץ תותח', 0, 'two', 1, 0, 1565539446, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/vDTsTTXIvQZhqZuh'),
(381, 'זורקים לאוויר 5 אבנים או כדורי נייר 	כך שיעברו את גובה הראש ומנסים לתפוס ביד הזורקת כמה שיותר מהם', 'בכל פעם הזורק מתקדם בצעדי עקב-בצד-אגודל במספר צעדים כמספר האבנים שהצליח לתפוס', 'דוגמה: אם הזורק תפס 3 אבנים, הוא מתקדם 3 צעדים, וממהר לזרוק שוב', NULL, NULL, NULL, 1565539800, 'mix', 'מרוץ אבנים', 0, 'two', 1, 1, 1565540041, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/YLVV8m8G5o9fm8GF'),
(382, 'בונים מגדל אבנים כמה שיותר גבוה	', 'בכל שכבה של המגדל ישנה רק אבן אחת', 'נפל? מתחילים חדש. מגדל שכזה נקרא רוג\'ום\n', NULL, NULL, NULL, 1565542207, 'mix', 'רוג\'ום', 0, 'two', 1, 1, 1565542486, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/8titnsyErE4WEwLs'),
(383, 'במסורת האינדיאנית הטבע רומז לכל אדם על עצמו ועל עתידו, והמשימה של כל אחד היא לשים לב ולהבין מה הטבע אומר לו אישית	\n', 'כל אחד הולך לבדו בטבע בשקט חצי שעה ושם לב מה תופס את תשומת ליבו במרחב: טור נמלים, עץ הנמוך מאלו שלידו, ענן מעניין, אבן חריגה, צבעי האופק, חור בגז', 'הצ\'יף ידע לפרש את הדברים הללו, אולם בהעדר צ\'יף כל אחד מקבל את המשמעות לגביו של הדברים שהוא שם לב אליהם בטבע מהמדריך, מהקבוצה, מעצמו, או מהשניים ', NULL, NULL, NULL, 1565542692, 'mix', 'דבר הצ\'יף', 0, 'two', 2, 1, 1565588971, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/tnspiR6HQtGMnAkC'),
(384, 'כולם ממלאים את הפה במים, אפילו במעט מים', 'צריך לנהל שיחה מובנת עם המים בפה', 'אפשר גם ללא מים עם החלטה שהשיחה מתנהלת מבלי לחשוף את השיניים', NULL, NULL, NULL, 1565543588, 'mix', 'מים מדברים', 0, 'two', 1, 1, 1565543885, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/Hon1juXfYgl03cOw'),
(385, 'מסמנים שני שטחים זהים בגודלם	\n', 'כל קבוצה מחביאה באדמה, בסלעים ובשיחים בשטח של הקבוצה השנייה \'מטבעות אוצר\' שהם איצטרובלים, ענפים קטנים או כל דבר שאין באופן טבעי באותו השטח	', 'בזמן נתון צריך למצוא כמה שיותר מטבעות מהאוצר', NULL, NULL, NULL, 1565544265, 'mix', 'האוצר', 0, 'two', 1, 1, 1565544637, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/y1YR2YAuoBLTrnD7'),
(387, 'כל אחד בתורו מציג הנחה מאוד מובנת מאליה, וכולם מתארים איך העולם יפעל ויראה אם ההנחה שנאמרה פתאום תהיה לא נכונה	', 'דוגמאות: הנחה 1: כל דבר נופל למטה. אם לא: נהיה קשורים לרצפה כל הזמן. הנחה 2: בנים אוהבים כדורגל יותר מבנות. ואם לא: אצטרדיון ווימבלדון יהיה מלא בא', 'הנחה 3: הפסקות זה כיף. אם לא: המורה תעניש לצאת להפסקה וכולם יתחננו שלא. הנחה 4: אני תמיד צודק. ואם לא: אז אולי אני צריך לשים לב טוב לכל מה שאומרים ', NULL, NULL, NULL, 1565850597, 'mix', 'אם לא?', 0, 'two', 1, 1, 1565851122, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/qfBkGjcpUQhygOP7'),
(388, 'א\' וב\' יושבים משני צדדיו של ג\' וביחד, בדיוק באותו הזמן, לוחשים לו באוזן משפט קצר, כל אחד לוחש משפט אחר	', 'ג\' צריך לשחזר כמה שיותר משני המשפטים שנלחשו לו. מתחילים במשפט של 2 מילים, ובכל פעם מאריכים את המשפט בעוד מילה	', 'ג\' בוחר בליבו האם להקשיב רק לא\' או רק לב\', ובסוף לשחזר את המשפט שהוא אמר. אפשרות שג\' מכריז מראש למי הוא מתכוון להקשיב, והשני מנסה ללא הרמת קול למ', 'מחליטים על מילה כלשהי, וכאשר א\' או ב\' משבצים בדבריהם את המילה הזאת ג\' צריך להעביר את הקשב לזה שאמר את המילה שנקבעה\n', NULL, NULL, 1566626724, 'mix', 'סטריאו', 1, 'two', 1, 1, 1566628798, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/d9ZS9Nxzz6ly9gny'),
(389, 'משמיעים מוסיקה בווליום המקסימלי האפשרי, ברמקול או באוזניות	', 'המשתתפים מדברים עם עצמם, ובגלל המוסיקה לא שומעים אף אחד	', 'האחראי מכבה מידי פעם את המוסיקה, וכולם צריכים להמשיך את השיחה שניהלו עם עצמם למרות שכעת שומעים אותם\n', 'מדברים בזוגות מבלי לשמוע אחד את השני, וכשהמוסיקה מופסקת ממשיכים את השיחה המשונה לפני כולם, בכל פעם זוג אחר\n', 'בזמן שהם כן שומעים אחד את השני מנסים בני הזוג להפוך את הדיאלוג להרמוני עם הגיון', NULL, 1567619311, 'mix', 'רעש', 1, 'two', 1, 1, 1567620140, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/6xBuAEnSkkDHTW7B'),
(390, '	א\' שואל את ב\' שאלה-בקשה שמתחילה במילים \"מה הסיכוי ש...\". כגון: מה הסיכוי שתקנה לי חבילת שוקולד? מה הסיכוי שתרכיב אותי על הגב דקה?	', 'ב\' אומר מספר בין 1 ל 100. ואז א\' וב\' אומרים \"שלוש ארבע ו\" ואומרים ביחד מספר שעלה לכל אחד מהם בראש בין 1 למספר שב\' אמר	', 'אם הם אמרו במקרה את אותו המספר, ב\' מחויב לבצע את המשאלה שהביע א\' בשאלת \"מה הסיכוי\". ככל שנכונותו של ב\' נמוכה יותר כך הוא יציג מספר גבוה יותר\n', NULL, NULL, NULL, 1568353815, 'mix', 'מה הסיכוי', 0, 'two', 1, 1, 1568353998, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/3FqOX3ga1FBYx905'),
(391, 'משחקים כמו בכיסאות מוסיקליים - כשהמוסיקה נפסקת כולם מנסים לתפוס כיסא, ובכל פעם מוציאים כיסא אחד	\n', 'ישנו משתתף אחד יותר ממספר הכיסאות, וזה שלא הצליח לתפוס כיסא מתיישב עם מישהו ביחד על כיסא אחד	 ', 'כך שוב ושוב, עד שעל כל הכיסאות יושבים בזוגות/שלשות. אף אחד לא נפסל ולא יוצא מהמשחק', NULL, NULL, NULL, 1568431603, 'mix', 'כיסאות ', 0, 'two', 1, 1, 1568432122, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'http://playlist.motowelove.com/storage/playlist/GKvRa38dOS9umlfA');
