INSERT INTO `workshop` (`id_workshop`, `img`, `text`, `show`, `name`, `date`, `order_index`, `requests`) VALUES
(3, 'http://playlist.motowelove.com/storage/workshop/cPONC1JGozCvKEcA.jpg', '● הילדים לומדים משחקים חברתיים ללא ציוד \n● המשחקים הם ללא מפסידים - להכלה של כולם\n● האקדמיה למדעי ההפסקה (www.academia.games) מפעילה את התוכנית ומכשירה את הבוגרים כמאמנים חברתיים\n● לשינוי אקלים ביה\"ס בהפסקות ולהורדת האלימות\n● מערך להטמעת המשחקים בבית-הספר בקביעות \n● ביה\"ס מקיים הפנינג שוב ושוב עצמאית ללא עלויות\n', 1, 'הפנינג משחקים להפסקות בבית-הספר', 1551121628, 1, 2),
(5, 'http://playlist.motowelove.com/storage/workshop/zT3q4c7isrnyBXxG.jpg', '● משחקים לזמן איכות זוגי, ולדייטים זורמים', 1, 'סדנת זוגיות ', 1554610775, 6, 0),
(6, 'http://playlist.motowelove.com/storage/workshop/RKBTotia4i6CrGho.jpg', '● למפספסים הצלחות מאימת הכישלון\n● נחווה את הכישלון כשלב הכרחי להצלחה \n● נשחק משחקים בהם ההפסד הוא חלק מהמשחק', 0, 'סדנת worst case scenario', 1554711895, 9, 0),
(7, 'http://playlist.motowelove.com/storage/workshop/rLKV5vviRipcqkqf.jpg', '● גיבוש המשפחה בכיף\n● משחקים יצירתיים ופשוטים ללא ציוד\n● את המשחקים ניתן לשחק שוב ושוב באופן עצמאי', 1, 'סדנת משפחה משחקת', 1554712817, 5, 0),
(8, 'http://playlist.motowelove.com/storage/workshop/3LMLhOs6ROWkMKkg.jpg', '● משחקים ללא ציוד להוראה ולמידה בכיף\n●  משחקים לשחרור מתחים וליצירת אקלים נעים \n● משחקים לגיבוש הכיתה וחיבור הילדים שבשוליים', 1, 'סדנת משחקים לאנשי חינוך', 1554713006, 3, 5),
(9, 'http://playlist.motowelove.com/storage/workshop/j5uGEEhuHVXKp3JC.jpg', '● לומדים להגיע לאינטימיות בקלות ובכיף\n● מכירים משחקים ושאלות שיוצרים אינטימיות\n● עם בני/ות זוג, חברים, ילדים ועם עצמך ', 1, 'סדנת אינטימיות', 1554713192, 7, 0),
(11, 'http://playlist.motowelove.com/storage/workshop/tR4Ifbu6r9c4vavR.jpg', '● הפנינג קהילתי של משחקים יצירתיים\n● המון צחוק וגיבוש בין ההורים ובין הילדים\n● המשחקים ללא ציוד, והם נשארים נכס קהילתי', 1, 'סדנת קהילה משחקת', 1555304452, 4, 0),
(17, 'http://playlist.motowelove.com/storage/workshop/mMcxsR7wvFrFTTOA.jpg', '● למפספסים הצלחות מאימת הכישלון\n● נחווה את הכישלון כשלב הכרחי להצלחה \n● נשחק משחקים בהם ההפסד הוא חלק מהמשחק\n● נתגבש סביב מסר משמעותי לקידום העובדים והעסק', 1, '   סדנת worst case scenario', 1555519694, 2, 1);
